import "./styles.css";
const ToDo = () => {
  return (
    <>
    <div className='main-div'>
        <div className='child-div'>
            <figure>
                <img src='./logo192.png' alt="img"></img>
            </figure>
        </div>
    </div>
    </>
  )
}

export default ToDo
